sass.writeFile("modules/demo/demo.scss", "h1.logo {\n  width: 1000px;\n  margin: 60px auto;\n  font-size: 140px;\n  text-transform: capitalize;\n  font-variant: small-caps;\n  color: $theme;\n}\nh1.logo small{\n  font-size: 20px;\n  color: desaturate($grey, 10%);\n  font-family: sans-serif;\n}\n\nsection {\n  font-family: verdana, \"microsoft yahei\";\n  width: 1000px;\n  margin: 0 auto 50px auto;\n  overflow: hidden;\n}\n\nsection h2.demo-h2 {\n  font-size: 30px;\n  color: #666;\n  margin-bottom: 30px;\n  padding-top: 20px;\n  font-weight: normal;\n  text-transform: capitalize;\n  font-variant: small-caps;\n}\n\nsection article {\n  margin-bottom: 15px;\n}\n/*demo*/\n\n.module {\n  margin: 0 auto;\n  width: 80%;\n  text-align: center;\n}\n.column p.col-num {\n  text-align: center;\n  background-color: $grey;\n  height: 45px;\n  line-height: 45px;\n  margin: 10px 0;\n  color: $text;\n  float: none;\n}\n\n.column:hover p.col-num {\n  background-color: desaturate($grey, 10%);\n}\n/*Theme Color*/\n.demo-color {overflow: hidden;}\n.demo-color li{\n  float:left;\n  width: 22%;\n}\n.demo-color li .color{\n  margin-bottom:15px;\n}\n.color{\n  display: block;\n  width: 50px;\n  height: 50px;\n  border-radius: 20%;\n  padding:0;\n  background-color: $theme;\n}\n.color-light{\n  background-color: lighten($theme, 10%);\n}\n.color-dark{\n  background-color: desaturate($theme, 10%);\n}\n\n$demo-colors: (blue $blue) (green $green) (orange $orange) (grey $grey) (text $text);\n\n.color {\n  @each $demo-color in $demo-colors{\n    $demo-color-name: nth($demo-color, 1);\n    $demo-color-background-color: nth($demo-color, 2);\n\n    &.#{$demo-color-name} {\n      background-color: #{$demo-color-background-color};\n    }\n    &.#{$demo-color-name}-light{\n        background-color: lighten($demo-color-background-color, 10%);\n    }\n    &.#{$demo-color-name}-dark{\n      background-color: desaturate($demo-color-background-color, 10%);\n    }\n  }\n}\n\n.demo-tip {position: relative;width: 1000px;height: 50px;}\n.demo-tip .tip-top{margin-left: 0%;}\n.demo-tip .tip-right{margin-left: 20%;}\n.demo-tip .tip-bottom{margin-left: 40%;}\n.demo-tip .tip-left{margin-left: 60%;}\n\n.demo-calendar{position: relative;height: 300px}\n");
