sass.writeFile("modules/margin/margin.scss", "// config\r\n$blacks:\r\n'margin'\r\n'margin-top'\r\n'margin-right'\r\n'margin-bottom'\r\n'margin-left'\r\n'padding'\r\n'padding-top'\r\n'padding-right'\r\n'padding-bottom'\r\n'padding-left' !default;\r\n\r\n$black-values: (5 10 15 20 25 30) !default;\r\n\r\n// mixin\r\n@each $block in $blacks {\r\n  .#{$block}{\r\n    #{$block}: 0 !important;\r\n  }\r\n  @each $black-value in $black-values {\r\n    .#{$block}-#{$black-value}{\r\n      #{$block}: #{$black-value}px !important;\r\n    }\r\n  }\r\n}");
sass.writeFile("modules/notice/notice.scss", "/*\n* Config\n* \n*/\n$notice-namespace: '.notice' !default;\n\n$notice-background: $theme !default;\n$notice-padding: 20px;\n$notice-color: #fff !default;\n\n// (name background) \n$notice-colors: (bule $blue)\n                (green $green)\n                (orange $orange)\n                (grey $grey)\n                !default;\n\n/*\n*\n* Mixin\n*/\n@mixin notice-color {\n  @each $notice-color in $notice-colors {\n    $notice-name: nth($notice-color, 1);\n    $notice-background: nth($notice-color, 2);\n    $notice-color-namespace: $notice-namespace + '-' + $notice-name;\n\n    #{$notice-color-namespace} {\n      background: $notice-background;\n    }\n  }\n};\n\n\n/*\n*\n* Base\n*/\n#{$notice-namespace} {\n  padding: $notice-padding;\n  color: $notice-color;\n  background-color: $notice-background;\n}\n\n#{$notice-namespace} h1 {\n  font-size: 16px;\n  font-weight: bolder;\n  margin: 0 0 10px 0;\n}\n\n@include notice-color;");
sass.writeFile("modules/page/page.scss", ".page {\n  font-size: 0;\n  -webkit-user-select:none;\n}\n.page a {\n  border: 2px solid $grey;\n  color: $text;\n  padding:10px 16px;\n  text-align: center;\n  text-decoration: none;\n  margin-right: -2px;\n  font-size: 14px;\n  display: inline-block;\n  line-height: 1.5;\n  vertical-align: middle; /*ie678 解决汉子和数字上下不对齐*/\n}\n.page a:first-child {\n  border-top-left-radius: var(--radius);\n  border-bottom-left-radius: var(--radius);\n}\n.page a:last-child {\n  border-top-right-radius: var(--radius);\n  border-bottom-right-radius: var(--radius);\n}\n.page a.now,.page a:hover {\n  background-color: $grey;\n}\n.page a.disabled {\n  color: #999999;\n}\n.page.page-right{\n  text-align: right;\n}\n.page.page-right a {\n  margin-right: 0;\n  margin-left: -2px;\n}\n\n/*兼容*/\n.ie6 .page a.disabled{\n  background-color: transparent !important;\n  color: #999;\n}");
sass.writeFile("modules/progress/progress.scss", ".progress{\n\theight: 31px;\n\tline-height: 31px;\n  border:4px solid var(--grey-light);\n\tbackground-color: var(--grey-light);\n}\n.progress-bar{\n\tbackground-color: var(--theme);\n  background-image: repeating-linear-gradient(-45deg, var(--theme), var(--theme) 10px, var(--theme-hover) 10px, var(--theme-hover) 20px);\n\tcolor: var(--grey-light);\n\ttext-align: center;\n  animation: barAnimation 12s linear infinite;\n}\n.progress.success .progress-bar{\n\tbackground-color: var(--success);\n  background-image: repeating-linear-gradient(-45deg, var(--success), var(--success) 10px, var(--success-hover) 10px, var(--success-hover) 20px);\n}\n\n@keyframes barAnimation{\n  from {\n    background-position: 0% 0%;\n  }\n  to {\n    background-position: 600px 0%;\n  }\n}\n\n.progress-small{\n  height: 14px;line-height: 14px;\n}\n\n.progress.radius{\n  border-radius: 20px;\n  overflow: hidden;\n}\n");
sass.writeFile("modules/reset/reset.scss", "/**\r\n * reset\r\n *\r\n * @author Ma Junbao <mlive@live.cn> || @github.com/majunbao\r\n*/\r\na,\r\nabbr,\r\naddress,\r\narticle,\r\naside,\r\naudio,\r\nb,\r\nblockquote,\r\nbody,\r\ncaption,\r\ncite,\r\ncode,\r\ndd,\r\ndel,\r\ndfn,\r\ndialog,\r\ndiv,\r\ndl,\r\ndt,\r\nem,\r\nfieldset,\r\nfigure,\r\nfooter,\r\nform,\r\nh1,\r\nh2,\r\nh3,\r\nh4,\r\nh5,\r\nh6,\r\nheader,\r\nhgroup,\r\nhr,\r\nhtml,\r\ni,\r\niframe,\r\nimg,\r\nins,\r\nkbd,\r\nlabel,\r\nlegend,\r\nli,\r\nmark,\r\nmenu,\r\nnav,\r\nobject,\r\nol,\r\np,\r\npre,\r\nq,\r\nsamp,\r\nsection,\r\nsmall,\r\nspan,\r\nstrong,\r\nsub,\r\nsup,\r\ntable,\r\ntbody,\r\ntd,\r\ntfoot,\r\nth,\r\nthead,\r\ntime,\r\ntr,\r\nul,\r\nvar,\r\nvideo {\r\n  border: 0;\r\n  margin: 0;\r\n  outline: 0;\r\n  padding: 0;\r\n  font-size: 100%;\r\n  font-weight: normal;\r\n}\r\n\r\narticle, aside, details, figcaption, figure, footer, header, hgroup, nav, section {\r\n  display: block;\r\n}\r\n\r\naudio, canvas, video {\r\n  display: inline-block;\r\n  *display: inline;\r\n  *zoom: 1;\r\n}\r\n\r\naudio:not([controls]) {\r\n  display: none;\r\n}\r\n\r\n[hidden] {\r\n  display: none;\r\n}\r\n\r\nhtml {\r\n  width: 100%;\r\n  height: 100%;\r\n  font-size: 100%;\r\n  -webkit-text-size-adjust: 100%;\r\n  -ms-text-size-adjust: 100%;\r\n}\r\n\r\nbody {\r\n  margin: 0;\r\n  padding: 0;\r\n  width: 100%;\r\n  height: 100%;\r\n  overflow-y: visible !important;\r\n}\r\n\r\na {\r\n  text-decoration: none;\r\n  -webkit-tap-highlight-color: transparent;\r\n}\r\n\r\nimg {\r\n  border: 0;\r\n  -ms-interpolation-mode: bicubic;\r\n  vertical-align: middle;\r\n  font-size: 0;\r\n}\r\n\r\nul {\r\n  list-style: none;\r\n}\r\n\r\ntable {\r\n  border-collapse: collapse;\r\n  border-spacing: 0;\r\n}\r\n\r\nth, td, caption {\r\n  vertical-align: top;\r\n  text-align: left;\r\n}\r\n\r\n.icon {\r\n  display: inline-block;\r\n  *display: inline;\r\n  *zoom: 1;\r\n  background: none;\r\n  border: 0;\r\n}\r\n\r\n::-ms-clear, ::-ms-reveal {\r\n  display: none;\r\n  width: 0;\r\n  height: 0;\r\n}\r\n\r\n\r\n\r\nbody, input, textarea, keygen, select, button {\r\n  color: #333;\r\n  font-size: 14px;\r\n  font-family: \"PingHei\",\"Lucida Grande\", \"Lucida Sans Unicode\", \"Helvetica\",\"Arial\",\"Verdana\",\"sans-serif\";\r\n}\r\n\r\nbody, input, textarea, select, button {\r\n  text-rendering: optimizeLegibility;\r\n  -webkit-font-smoothing: antialiased;\r\n  -moz-osx-font-smoothing: grayscale;\r\n  -moz-font-feature-settings: \"liga\", \"kern\";\r\n}\r\n\r\n*:active,*:focus {\r\n  outline: none; \r\n}\r\n\r\ninput, textarea, .button{\r\n  /*去除ios webkit默认样式*/\r\n  -webkit-appearance: none;\r\n  -webkit-border-radius: 0;\r\n  -moz-border-radius: 0;\r\n  -ms-border-radius: 0;\r\n  border-radius: 0;\r\n}\r\n\r\n");
