sass.writeFile("modules/tab/tab.scss", "/*\n* Tab Config\n*/\n\n$tab-namespace: '.tab' !default;\n$tab-header-height: 38px;\n\n#{$tab-namespace} {\n  position: relative;\n}\n#{$tab-namespace} ul#{$tab-namespace}-header{\n  height: $tab-header-height;\n}\n#{$tab-namespace} ul#{$tab-namespace}-header li{\n  float: left;\n  height: 100%;\n}\n#{$tab-namespace} ul#{$tab-namespace}-header li a {\n  display: inline-block;\n  background-color: $theme;\n  text-align: center;\n  padding: 0 10px;\n  min-width: 80px;\n  text-decoration: none;\n  color: #fff;\n  height: 100%;\n  line-height: $tab-header-height;\n  border-left: 1px solid desaturate($theme, 20%);\n}\n#{$tab-namespace} ul#{$tab-namespace}-header li.now a{\n  color: #000;\n  font-weight: bold;\n  background-color: #f4f5f9;\n}\n#{$tab-namespace} div#{$tab-namespace}-content{\n  display: none;\n}\n#{$tab-namespace} div#{$tab-namespace}-content.now{\n  display: block;\n  padding: 15px 10px;\n  background-color: #f4f5f9;\n}\n\n/*兼容*/\n.ie6 #{$tab-namespace} div.now,\n.ie7 #{$tab-namespace} div.now{\n  /*这个不用display:block;是为了兼容IE67浏览器*/\n  display: inline-block;\n}\n.ie6 #{$tab-namespace} ul#{$tab-namespace}-header li a{\n  width: expression(this.scrollWidth>100?'auto':'79px');\n}\n\n");
