sass.writeFile("modules/table/table.scss", "table {\n  width: 100%;\n  color: #576077;\n  font-size: 14px;\n}\n\ntable {\n  border:2px solid #f4f5f9;\n}\n\ntable tr th:first-child{\n  border-top-left-radius: 4px;\n}\n\ntable th, table td {\n  text-align: center;\n  padding: 15px;\n}\n\ntable tr th:last-child{\n  border-top-right-radius: 4px;\n}\n\ntable th {\n  color: #515163;\n  background-color: #f4f5f9;\n}\n\ntable td {\n  border:2px solid #f4f5f9;\n}\n\ntable.dark{\n  border-width:0;\n}\n\ntable.dark th{\n  background-color: #3f3f4d;\n  color: #c0c7da;\n}\n\ntable.dark td {\n  border-width:0;\n}\n\ntable.dark tbody tr:nth-child(even){\n  background-color: #f4f5f9;\n}\n\ntable.noborder th,table.noborder td{\n  border: 0\n}\n\n/*兼容*/\n\n.ie table.dark{\n  background-color: transparent;\n}\n\n.ie table.dark td{\n  border: 2px solid #f4f5f9;\n}");
sass.writeFile("modules/text/text.scss", ".text-bold {\r\n  font-weight: bold;\r\n}\r\n\r\n.text-italic {\r\n  font-style: italic;\r\n}\r\n\r\n.text-underline {\r\n  text-decoration: underline;\r\n}\r\n\r\n.text-line-through {\r\n  text-decoration: line-through;\r\n}\r\n\r\n.align-left {\r\n  text-align: left;\r\n}\r\n\r\n.align-right {\r\n  text-align: right;\r\n}\r\n\r\n.align-center {\r\n  text-align: center;\r\n}\r\n\r\n.text-align-justify {\r\n  text-align: justify;\r\n}\r\n\r\n.text-tiny {\r\n  font-size: 10px;\r\n}\r\n\r\n.text-small {\r\n  font-size: 12px;\r\n}\r\n\r\n.text-large {\r\n  font-size: 16px;\r\n}\r\n\r\n.text-larger {\r\n  font-size: 18px;\r\n}\r\n\r\n.text-opacity {\r\n  opacity: 0.5;\r\n}\r\n\r\n.text{\r\n  color: $text\r\n}\r\n\r\n.text-light{\r\n  color: $text-light;\r\n}\r\n\r\n.text-dark{\r\n  color: $text-dark;\r\n}");
sass.writeFile("modules/textarea/textarea.scss", "/*\n* Config\n*/\n$textarea-namespace: 'textarea' !default;\n\n$textarea-width: 468px !default;\n$textarea-height: 88px  !default;\n$textarea-padding: 10px !default;\n$textarea-border-color: $grey !default;\n\n$textarea-colors: (blue $blue)\n                  (green $green)\n                  (orange $orange)\n                  !default;\n\n/*\n* Mixin\n*/\n@mixin textarea-colors{\n  @each $textarea-color in $textarea-colors {\n    $textarea-name: nth($textarea-color, 1);\n    $textarea-border-color: nth($textarea-color, 2);\n    $textarea-color-namespace: '.' + $textarea-name + '-' + $textarea-name;\n  }\n}\n\n/*\n* Base\n*/\n\n#{$textarea-namespace} {\n  margin: 0;\n  border: 0;\n  outline: none;\n  overflow: auto;\n  border: 2px solid $textarea-border-color;\n  padding: $textarea-padding;\n  width: $textarea-width;\n  min-height: $textarea-height;\n}\n#{$textarea-namespace}:hover {\n  border-color: lighten($textarea-border-color, 10%);\n}\n\n#{$textarea-namespace}:focus,#{$textarea-namespace}:active{\n  border-color: desaturate($textarea-border-color, 10%);;\n}\n\n#{$textarea-namespace}[disabled],\n.#{$textarea-namespace}-disabled {\n  background-color: $disabled;\n  border: 2px solid $disabled;\n  color: #fff;\n}\n\n#{$textarea-namespace}[disabled]:hover,\n#{$textarea-namespace}[disabled]:focus\n.#{$textarea-namespace}-disabled:hover,\n.#{$textarea-namespace}-disabled:focus {\n  cursor: not-allowed;\n}\n\n@include textarea-colors;\n\n\n/*兼容*/\n.ie6 textarea{\n  height: 88px;\n  background-color: transparent;\n}\n");
sass.writeFile("modules/theme/信息技术.scss", "$blue: red;\n\n$green: #34c276;\n\n$orange: #f9b954;\n\n$grey: #bababa;\n\n$dark: #3f3f4d;\n\n$link: #5ecbf2;\n$disabled: #dde2ef;\n\n$text: #767676;\n$text-light: #969696;\n$text-dark: #464646;\n\n$theme: $blue;\n");
sass.writeFile("modules/theme/大技术平台.scss", "$blue: #55cffb !default;\n\n$green: #34c276 !default;\n\n$orange: #f9b954 !default;\n\n$grey: #bababa !default;\n\n$dark: #3f3f4d !default;\n\n$link: #5ecbf2 !default;\n$disabled: #dde2ef !default;\n\n$text: #767676 !default;\n$text-light: #969696 !default;\n$text-dark: #464646 !default;\n\n$theme: $blue !default;");
sass.writeFile("modules/tip/tip.scss", "tip{\n  display: block;\n  position: absolute;\n  z-index: 1000;\n  max-width: 220px;\n}\ntip .tip-inner{\n  background-color: desaturate($dark, 10%);\n  color: lighten($grey, 20%);\n  padding:8px 22px;\n  border-radius: 6px;\n  line-height: 1.5;\n}\ntip .tip-arrow{\n  position: absolute;\n  width: 0;\n  height: 0;\n  line-height: 0;\n  border:5px dashed desaturate($dark, 10%);\n}\ntip.tip-top .tip-arrow, tip.tip-bottom .tip-arrow{\n  left: 50%;\n  margin-left: -5px;\n  border-right-color: transparent;\n  border-left-color: transparent;\n}\n\ntip.tip-left .tip-arrow, tip.tip-right .tip-arrow{\n  top: 50%;\n  margin-top: -5px;\n  border-top-color: transparent;\n  border-bottom-color: transparent;\n}\ntip.tip-left .tip-arrow{\n  right:0;\n  border-right: none;\n  border-left-style: solid; /*IE678*/\n}\ntip.tip-right .tip-arrow{\n  left: 0;\n  border-left: none;\n  border-right-style: solid; /*IE678*/\n}\ntip.tip-top .tip-arrow{\n  bottom:0;\n  border-bottom: none;\n  border-top-style: solid; /*IE678*/\n}\ntip.tip-bottom .tip-arrow{\n  top: 0;\n  border-top: none;\n  border-bottom-style: solid; /*IE678*/\n}\n\n.tip-top{padding-bottom: 5px;}\n.tip-right{padding-left: 5px;}\n.tip-bottom{padding-top: 5px;}\n.tip-left{padding-right: 5px;}\n\n\ntip.small .tip-inner{font-size: 12px;padding:5px 15px;}\n\n\n/*兼容*/\n.ie6 .tip-top{padding-bottom: 5px;}\n.ie6 .tip-right{padding-left: 5px;}\n.ie6 .tip-bottom{padding-top: 5px;}\n.ie6 .tip-left{padding-right: 5px;}\n.ie6 tip{width: expression(this.scrollWidth > 220 ? \"222px\" : \"auto\");}\ntip.small{width: auto !important}");
sass.writeFile("modules/tool/tool.scss", ".clear:after {\r\n  content: \"\\20\";\r\n  display: block;\r\n  height: 0;\r\n  clear: both;\r\n  visibility: hidden; }\r\n\r\n.clear {\r\n  *zoom: 1; }\r\n\r\n.on-left {\r\n  float: left; }\r\n\r\n.on-right {\r\n  float: right; }\r\n\r\n.block {\r\n  display: block; }\r\n\r\n.inline {\r\n  display: inline-block;\r\n  zoom: 1;\r\n  *display: inline; }\r\n\r\n.none {\r\n  display: none; }\r\n\r\n.hidden {\r\n  overflow: hidden; }");
sass.writeFile("modules/button/style/border.scss", "#{$btn-namespace}-border {\n  background: none;\n  line-height: $btn-height - 4;\n  height: $btn-height - 4;\n  min-width: $btn-width - $btn-padding * 2 - 4;\n  border-width: 2px;\n  border: 2px solid $btn-background;\n  color: $btn-color;\n  &:hover{\n    background: desaturate($btn-background, 10%);\n    color: $btn-color;\n  }\n  &:active {\n    background: desaturate($btn-background, 10%);\n    text-shadow: 0 1px 0 rgba(255, 255, 255, .3);\n    border-color: darken($btn-background, 12%);\n  }\n\n  @each $btn-color in $btn-colors {\n    $btn-name: nth($btn-color, 1);\n    $btn-background: nth($btn-color, 2);\n    $btn-color: nth($btn-color, 3);\n    $btn-name-namespace: $btn-namespace + '-' + $btn-name;\n    &#{$btn-name-namespace} {\n      border-color: $btn-background;\n      color: $btn-background;\n      &:hover{\n        background: desaturate($btn-background, 10%);\n        color: $btn-color;\n      }\n      &:active {\n        background: desaturate($btn-background, 10%);\n        text-shadow: 0 1px 0 rgba(255, 255, 255, .3);\n        border-color: darken($btn-background, 12%);\n      }\n    }\n  }\n}\n");
